DELIMITER $$
CREATE TRIGGER `tr_cobranza_pagar_factura` AFTER UPDATE ON `facturas` FOR EACH ROW update facturas_detalles 
		set pagado=1,
		pagado_monto = monto,
		fecha_pagado = new.fecha_pagada
		where new.pagado_terminado = 1
		and id_factura = old.id
$$
DELIMITER ;

