--
-- Disparadores `facturas_detalles`
--
DELIMITER $$
CREATE TRIGGER `tr_cobraza_pagar_servicio` AFTER UPDATE ON `facturas_detalles` FOR EACH ROW update servicios
	set 
	cobrado = cobrado + new.pagado_monto,
	saldo = saldo - new.pagado_monto,
	pago_fecha = new.fecha_pagado,
	pago = 'Realizado',
	pago_boolean = 1,
	estatus_cobranza = 'Pagado',
	mostrar_bitacora = 1
	where new.pagado = 1 
	and id = old.id_servicio
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_servicios_actualizar_facturas` AFTER DELETE ON `facturas_detalles` FOR EACH ROW update servicios set 
	facturado_terminado = 0,
	facturado = facturado - old.monto
	where id = old.id_servicio
$$
DELIMITER ;

